- name: Ministry of Testing Leeds - August 2019
  description: "<p>We can promise great food, talks and discussions as usual. Want to speak or need help to develop a topic? Would you like some feedback on an idea? Get in touch and we can help. We can cover travel and accommodation if you have to travel to speak at our meetup.</p> <p>6.00pm - 6.30pm: Networking and food</p> <p>6.30pm - 7.30pm: Talk: From Tester to CEO (Gav Winter)</p> <p>7.30pm - 7.45pm: Break</p> <p>7.45pm - 8.30pm: Lightning talks</p> <p>8.30pm - Pub (Editor's Draft)</p> <p>Details<br/>From Tester to CEO (Gav Winter)<br/>30th of June 2006 - Happy Birthday to me. I'd had a bad time of things, I didn't enjoy my job and I didn't like the service other testing consultancies were delivering. But what was I going to do about it?<br/>A story about how The Test People (now Ten10) became the fastest growing test consultancy in the UK</p> <p>Gav has been in the technology industry for over 20 years and is currently CEO of RapidSpike a Website monitoring, security and user analytics platform. He was the founder of The Test People (now Ten10), one of the fastest-growing tech companies in the UK and the fastest-growing in Yorkshire &amp; the North East[masked]. He won Yorkshire Overall &amp; SME Director of the Year 2014 &amp; 2015 plus multiple company awards like Deloitte Fast50, Sunday Times TechTrack100 and Best Companies before architecting a merger with a competitor to create Ten10, the UKs largest independent testing consultancy of which he is now a non-executive director.</p> <p>He is a CEO who loves building people-focused companies with passion &amp; purpose and his experience working within client-facing roles within the egaming, financial, trading, healthcare and utility sectors has also given him skills as a Business Adviser in Strategy, People, Communications and Marketing along with technical skills as a Testing Specialist, Agilist and Scrum Master.</p> <p>Ministry of Test Leeds is committed to providing an inclusive and welcoming environment for all attendees. To discuss any additional accessibility requirements you may have, please contact [masked].</p> "
